def truncate_tree_text(tree_text):
    """
    Truncates a text representation of a directory tree to retain only folders.

    :param tree_text: Multiline string representing the directory tree.
    :return: Modified tree with only folder names.
    """
    lines = tree_text.splitlines()
    truncated_lines = []

    # List of file extensions to filter out
    file_extensions = [
        '.pdf', '.txt', '.docx', '.xlsx', '.png', '.jpg', '.mp3', '.html',
        '.svg', '.ttf', '.woff', '.woff2', '.eot', '.css', '.ico', '.gif', '.js', '.css.map'
    ]

    for line in lines:
        # Add the line if it does not appear to represent a file
        if not any(line.strip().endswith(ext) for ext in file_extensions):
            truncated_lines.append(line)

    return "\n".join(truncated_lines)

result = truncate_tree_text(tree_text)
print(result)
